  [],\n\t\"revision_timestamp\": \"2015-05-06T21:40:44.772133\",\n\t\"name\": \"computational-wind-tunnel-a-design-tool-for-rotorcraft-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Rotorcraft engineers traditionally use the
  wind tunnel to evaluate and rnfinalize designs. Insufficient correlation between
  wind tunnel results and flight tests,rnhave been often attributed in part to uncertainty
  in blockage corrections.rnEstimation of rotor blockage is significantly more complex
  than bluff bodyrnblockage as the correction depends on operational characteristics
  such rnas rotor RPM and thrust produced.rnThis proposal offers to develop a design
  tool, which can simulate a complete rnrotorcraft inside a wind tunnel including
  all the facility effects.rnAt the heart of the innovation are:rn1. An automated
  hybrid grid generator.rn2. A robust and economical incompressible flow solver for
  the rngrid system.rn3. Momentum source based rotor model that is suitable and economical
  rnfor simulating multiple rotors including the drive fans of the wind tunnel.rnPhase
  I will develop the proof-of-concept and will use unstructured Cartesian rngrid for
  the model and wind tunnel. The wind tunnel will be modeled with the rndiffuser,
  test section and nozzle. rnIn phase II, the tool will be extended to hybrid grid
  with viscous grid near rnsolid surfaces and will include drive fans of the tunnel.rn\",\n\t\"license_title\":
